import React, { useState } from "react";
import CompatibilityForm from "./CompatibilityForm";
import Results from "./Results";

const Dashboard = () => {
  const [results, setResults] = useState(null);

  const handleSubmit = (data) => {
    // Send data to backend for ML and blockchain processing
    console.log("Submitted Data:", data);
    // Mock result for now
    setResults({ compatibility: "High", message: "Donor and receiver are highly compatible." });
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold mb-6 text-center">Organ Compatibility Tracker</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <CompatibilityForm onSubmit={handleSubmit} />
        {results && <Results data={results} />}
      </div>
    </div>
  );
};

export default Dashboard;
